import "./Popup.css";
const Popup = () => {
    return(
        <article className="popup">
            <div>
            <label htmlFor="name" className="popup__label">Naam</label>
            <input type="text" className="popup__input" id="name"/>
            </div>
            <button className="popup__button">Voeg toe</button>
        </article>
    )
}

export default Popup;
